//营销中心
let couponDetails = resolve => require(["@/views/market/coupon/coupon_details"], resolve);
export default[{
    path: '/market',
    name: 'market',
    component: resolve => require(["@/views/index"], resolve),
    children:[
        //海报详情
        {
            path: '/market_poster_details',
            name: 'market_poster_details',
            component: resolve => require(["@/views/market/poster/market_poster_details"], resolve),
            meta: {
                title: '海报管理详情'
            }
        },
        // 折扣列表
        {
            path: '/discount_manage_list',
            name: 'discount_manage_list',
            component: resolve => require(["@/views/market/discount/discount_manage_list"], resolve),
            meta: {
                title: '折扣管理'
            }
        },
        //新增折扣
        {
            path: '/discount_order_add',
            name: 'discount_order_add',
            component: resolve => require(["@/views/market/discount/discount_order_add"], resolve),
            meta: {
                title: '新建折扣'
            }
        },
        //编辑折扣
        {
            path: '/discount_order_edit',
            name: 'discount_order_edit',
            component: resolve => require(["@/views/market/discount/discount_order_edit"], resolve),
            meta: {
                title: '修改折扣'
            }
        },
        // 门店装修列表
        {
            path: '/store_decorate_list',
            name: 'store_decorate_list',
            component: resolve => require(["@/views/market/decorate/store_decorate_list"], resolve),
            meta: {
                title: '门店装修'
            }
        },
      
        // 门店装修详情
        {
            path: '/store_decorate_add',
            name: 'store_decorate_add',
            component: resolve => require(["@/views/market/decorate/store_decorate_add"], resolve),
            meta: {
                title: '门店装修详情'
            }
        },
        
        // 修改门店装修详情
        {
            path: '/store_decorate_edit',
            name: 'store_decorate_edit',
            component: resolve => require(["@/views/market/decorate/store_decorate_edit"], resolve),
            meta: {
                title: '门店装修详情'
            }
        },
        {
            path: '/market/coupon/add_coupon',
            name: 'add_coupon',
            component:couponDetails,
            meta: {
                title: '新建卡券'
            }
        },
        {
            path: '/market/coupon/edit_coupon',
            name: 'edit_coupon',
            component:couponDetails,
            meta: {
                title: '修改卡券'
            }
        },
        {
            path: '/market/coupon/show_coupon',
            name: 'show_coupon',
            component:couponDetails,
            meta: {
                title: '查看卡券'
            }
        },
    ]
}]
